          price: 70,
        },
        {
          id: 4,
          img: "https://images.pexels.com/photos/3964485/pexels-photo-3964485.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2",
          title: "Big Red M",
          artist: "Liudmila Ollie",
          isNew: true,
          tag: "Featured",
          oldPrice: 37.15,
          price: 37.15,
        },
      ];

    return (
        <div className="list">
            {data?.map(item=>(
                <Card item={item} key={item.id}/>
            ))}
        </div>
    )
}

export default List
